note_models.css:
.card {
 font-family: serif;
 font-size: 20px;
 text-align: center;
 color: black;
 background-color: white;
 display:none;
}

.known { color: var(--secondary-theme-color); font-size: 30px; font-weight: 700; margin: 0 5px 24px; padding: 10px;
         font-family: 'Libre Baskerville', serif; text-transform: uppercase; letter-spacing: .06em; line-height: 1em;}

.learned {color: #f2f2f2; background: var(--main-theme-color); font-size: 40px; font-weight: 700; margin: 0 5px 24px;
         font-family: 'Libre Baskerville', serif; letter-spacing: .2em; line-height: 1.3em;}

.hidden {display:none;}
.initial {display:initial;}

.clarification_context:before {content: "("}
.clarification_context:after {content: ")"}

div#frontOnBack .only-front {display:none;}

div#badges_table {--display-badge:none;}
div#badges_table div {display:var(--display-badge); padding-right:10px; width:100px;}

div#badge_indication_expression:before {content: url(data:image/png;base64,);}
